import React from "react";
import { listImage } from "../assets/images/LinkImages";

export default function Information() {

  return (
    <div className="max-w-[1440px]">
      <div className="flex">
        <p className="text-[#8B8BA5]  m-auto">Information</p>
      </div>

      <div className="flex">
        <p className="text-black font-medium font-bold text-[32px] m-auto">Special To Buy</p>
      </div>

      <div className="flex">
            {listImage.map((e)=>{ 
            return <div className="w-[287px] h-[300px]">
                <img src={e}/>
            </div>})}
      </div>

    </div>
  );
}
